#more in depth analysis of Erlotinib and Gefitinib


from NER import NER_diseases

import csv
import sys
import ast

csv.field_size_limit(sys.maxsize)
def get_reviews():
    with open('//data/rels_with_rev.csv', 'r') as read_obj:
        csv_reader = csv.reader(read_obj)
        return list(csv_reader)


def get_papers():
    with open('//data/papers_db.csv', 'r') as read_obj:
        csv_reader = csv.reader(read_obj)
        return list(csv_reader)

fullpapers = get_papers()

reviews = get_reviews()
papers = {'ERLOTINIB':[], 'GEFITINIB':[]}
for i in reviews:
    if i[1] == 'ERLOTINIB' or i[1] == 'GEFITINIB':
        papers[i[1]] = papers[i[1]] + ast.literal_eval(i[3])

totaltext = ''
a = 0
for i in fullpapers:
    if i[-1] in list(papers['GEFITINIB']):
        totaltext = totaltext + i[1] + ' ' + i[0]


all_gene_concepts = NER_diseases(totaltext)

